package com.seoul.juminprogram.Jsoup_folder;

import java.io.IOException;
import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;

import org.jsoup.Jsoup;
import org.jsoup.nodes.Document;
import org.jsoup.select.Elements;

public class Jsoup_jongno_23 {

	String jsoupUrl = "http://jachi.jongno.go.kr/JUMIN/sub03/sub03_01.aspx?", dong_url;
	String click_url = "http://jachi.jongno.go.kr/JUMIN/sub03/";

	public List<HashMap<String, String>> parse(int spinnerNum) {

		List<HashMap<String, String>> dataList = new ArrayList<HashMap<String, String>>();

		switch (spinnerNum) {
		case 0:
			dong_url = "";
			break;
		case 1:
			dong_url = "";
			break;
		case 2:
			dong_url = "";
			break;
		case 3:
			dong_url = "";
			break;
		case 4:
			dong_url = "";
			break;
		case 5:
			dong_url = "";
			break;
		case 6:
			dong_url = "";
			break;
		case 7:
			dong_url = "";
			break;
		case 8:
			dong_url = "";
			break;
		case 9:
			dong_url = "";
			break;
		case 10:
			dong_url = "";
			break;
		case 11:
			dong_url = "";
			break;
		case 12:
			dong_url = "";
			break;
		case 13:
			dong_url = "";
			break;
		case 14:
			dong_url = "";
			break;
		case 15:
			dong_url = "";
			break;
		}

		try {
			int p = 1, totalP = 0;
			while (p > 0) {
				int end = 0;
				Document doc = Jsoup.connect(jsoupUrl).data("__EVENTTARGET", "ctl00$ContentPlaceHolder1$GridView1")
						.data("__EVENTARGUMENT", "page$" + p)

						.data("__LASTFOCUS", "").data("__VIEWSTATEGENERATOR", "53C1DA66")
						.data("__VIEWSTATEENCRYPTED", "").data("__VIEWSTATE", dong_url).timeout(5000).post();

				Elements e = doc.select(".GridViewRow td a");
				Elements contents = doc.select(".GridViewRow td span");
				if (p == 1) {
					Elements page = doc.select("#ctl00_ContentPlaceHolder1_GridView1 tbody tr table tr td a");
					totalP = page.size() + 1;
					System.out.println(totalP);
				}

				if (contents.size() == 0)
					break;
				for (int i = 0; i < e.size(); i++) {
					HashMap<String, String> data = new HashMap<String, String>();

					if (!contents.get(10 * i + 9).text().equals("마감")) {
						data.put("lecture", contents.get(10 * i + 3).text());
						data.put("link", click_url + e.get(i).attr("href"));
						dataList.add(data);
					} else
						end++;

				}
				if (p == totalP)
					break;
				else if (end > 9)
					break;
				else
					p++;
			}
		} catch (IOException e) {

			// TODO Auto-generated catch block
			e.printStackTrace();

		}
		return dataList;
	}
}
